import Data from './Data'

  const[cont] = [ 

    {
      'num' : "1:",
      'sml' :"yes",
      'name' : "Presbo",
      'email' : 'presbo@columbia.edu',
    }

  ]

  const Cont = () => {
    return (
      <> 
        {cont.map((num) => (
          <Data num = {num} sml = {sml} nam = {nam} email = {email}/>
        ))}
      </> 
    )
  } 

  export default Cont
